const saveAnimationFile = (animationData, filePath) => {
  // Convert the JavaScript object to a JSON string with pretty-printing
  const jsonData = JSON.stringify(animationData, null, 2);

  // Write the JSON data to the file
  fs.writeFile(filePath, jsonData, 'utf8', (err) => {
    if (err) {
      console.error('Error writing to file:', err);
    } else {
      console.log(`Animation data successfully saved to ${filePath}`);
    }
  });
};

const RestructureData = (data) => {
  const jabAnimationFrames = [];

  data.forEach(frame => {
    const animationFrame = {};

    Object.keys(frame[0]).forEach(jointName => {
      const jointData = frame[0][jointName];
      animationFrame[jointName] = {
        x: jointData.x,
        y: jointData.y,
        conf: jointData.conf,
      };
    });

    jabAnimationFrames.push(animationFrame);
  });

  return jabAnimationFrames; 
};
